      currentValue={props.currentValue} 
      totalValue={props.totalValue} 
      alarmOn={props.alarmOn}
      alarmOff={props.alarmOff}
    />
  */

  <Layout
  >
    <Details 
      name="University" 
      currentValue={data[0].D0}
      totalValue={16}
      alarmOn={data[0].D3}
      alarmOff={data[0].D4}
    />
  </Layout>

)

